    render() {
        return (
            <div style={main}>
                <h2 style={headingText}> Work <br/> Experience </h2>
            </div>

        )
    }

}

const main = {
    display: 'flex',
    height: '100vh',
    backgroundColor: "#dedede"
};

const headingText = {
    marginLeft: '20px',
    fontSize: '3rem'
}

export default Experience;
